import{_ as e,o as t,c as i,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 46.2-737 Special license plates for certain constitutional officers; fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-737.md","filePath":"vacode/46.2-737.md"}'),s={name:"vacode/46.2-737.md"},r=a('<h1 id="§-46-2-737-special-license-plates-for-certain-constitutional-officers-fees" tabindex="-1">§ 46.2-737 Special license plates for certain constitutional officers; fees. <a class="header-anchor" href="#§-46-2-737-special-license-plates-for-certain-constitutional-officers-fees" aria-label="Permalink to &quot;§ 46.2-737 Special license plates for certain constitutional officers; fees.&quot;">​</a></h1><p>The Commissioner, on application, shall issue to sheriffs, county and city treasurers and commissioners of the revenue, attorneys for the Commonwealth, circuit court clerks, and general registrars special license plates identifying the office held by the applicant.</p><p>The annual fee for license plates issued pursuant to this section shall be $25 plus the prescribed fees for (i) vehicle registration and (ii) license plates with reserved numbers or letters.</p><p>The provisions of subdivisions 1 and 2 of subsection B of § <a href="http://law.lis.virginia.gov/vacode/46.2-725/" target="_blank" rel="noreferrer">46.2-725</a> shall not apply to license plates issued under this section.</p><p>1976, c. 147, § 46.1-105.6; 1987, c. 696; 1989, c. 727; 1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0984" target="_blank" rel="noreferrer">984</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0300" target="_blank" rel="noreferrer">300</a>.</p>',5),n=[r];function o(c,l,f,p,h,d){return t(),i("div",null,n)}const g=e(s,[["render",o]]);export{u as __pageData,g as default};
